Family Guy: Back to the Multiverse introduces an all-new original story written and voiced by Family Guy talent and influenced by the famous Family Guy season eight episode, &quot;Road to the Multiverse&quot;, where Stewie and Brian travel on an out-of-this-world journey through Quahog's bizarre parallel universes. Gamers will travel through all-new settings on a mission to save Quahog and stop the destructive schemes of Bertram, Stewie's nemesis. Playing as either Stewie or Brian, each equipped with unique special weapons and abilities, gamers will encounter an array of Family Guy characters, references and gut-busting jokes. Additionally, fans can share this hilarious experience and invite friends and family to jump into the wild Family Guy world through drop-in/drop-out co-op multiplayer mode and competitive multiplayer challenges.

